css:
@-moz-document domain('tumblr.com'), url-prefix('http://www.tumblr.com/') {


 body {







    background: url('http://static.tumblr.com/qg4bnk6/3Bnlmc75i/untitefwwwwwwwwwled_1.png') right #333333 repeat fixed !important;







  }







#left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {background-color:#0C0C0C!important;}







ol#posts li.notification{background-color: #000000 !important;



border-bottom: 1px solid #2F465C !important;



color: #ACB1B9 !important;}







#left_column .dashboard_options_form {



   background: url('http://assets.tumblr.com/images/white_20.png')#000000;



}







#right_column a#dashboard_switch_blog_menu_current:hover {



   background: transparent;



}







#nav .nav_item.active{



   background-color:#353738



}







#left_column #posts .post .permalink{



   background-color:#2A2D30;



}







#nav .nav_item.active, #nav .nav_item .nav_menu, #nav .nav_item .nav_item_nipple .nav_item_nipple_pixel{



   background-color:#353738;



}







}
@namespace url(http://www.w3.org/1999/xhtml);







@-moz-document url-prefix('http://www.tumblr.com/') {















ol#posts li.post.new_post {







background: #ffffff url('http://i51.tinypic.com/zn1xub.png') center center no-repeat;}















img[src*="http://assets.tumblr.com/images/new_post_icons_no_labels.png"]{







    width:0;







    height:100px;







    padding-right:250px;







    opacity: 0;}}







ol#posts .post.new_post .new_post_label {







display:none !important;







